@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@base <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <> .

atm:CashCard a owl:Class .
atm:ATM a owl:Class .
atm:hasValidCashCard a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:CashCard .
atm:readsSerialNumber a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range xsd:string .
atm:readsBankCode a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range xsd:string .

[ a owl:Class ;
  owl:equivalentClass [ a owl:Restriction ;
                        owl:onProperty atm:hasValidCashCard ;
                        owl:someValuesFrom [ a owl:Class ;
                                             owl:intersectionOf ( atm:CashCard
                                                                  [ a owl:Restriction ;
                                                                    owl:onProperty atm:readsSerialNumber ;
                                                                    owl:someValuesFrom xsd:string ]
                                                                  [ a owl:Restriction ;
                                                                    owl:onProperty atm:readsBankCode ;
                                                                    owl:someValuesFrom xsd:string ] ) ] ] ] .
